  return (
    <div className="App">
      <Header/>
      <BrowserRouter>
        <Routes>
          <Route  path='/' element={<ItemsLists/>}/>
          <Route  path='/detail' element={<ItemDetail/>}/>
        </Routes>
      </BrowserRouter>
    </div>
  );
}
